export function getCountryName(id) {
  switch (id) {
    case 1:
      return strings.countries.rs;
      break;
    case 2:
      return strings.countries.gb;
      break;
    case 3:
      return strings.countries.de;
    default:
      return "undefined";
      break;
  }
}
